- input: "TEXT\x1CC00001917\x1CTEXT-00001\x1C\x1CF3XA\x1CIn May 2009 and in June 2009,
    we erroneously listed H3 transfers from the Wyoming Democratic Party NonFederal
    Account on Line 12 instead of properly listing them on Line 18(a). When these
    errors came to our attention, we corrected them, making said corrections after
    Dec. 18, 2009, but before Dec. 28, 2009. As a result, every new report we filed
    beginning with our June Monthly Report (5/1/09-5/31/09) and ending with our December
    Monthly Report (11/1/09-11/30/09) had inaccurate year-to-date totals on Lines
    12, 18(a), 18(c) and 20, Column B, and we had inaccurate totals on the same lines
    in Column A on our original June Monthly Report (5/1/09-5/31/09) and on our original
    July Monthly Report (6/1/09-6/30/09). We have already filed amended reports for
    some of those months, with corrected totals on those lines, and today we are amending
    the remaining reports, such that all of the most recent amended versions of the
    reports for 2009 will be accurate. This amendment corrects the totals listed in
    our December Monthly Report (11/1/09-11/30/09) that we filed on 12/18/09.  Any
    payroll related items on Schedule H4 were for the benefit of employees that did
    not spend over 25% of the compensated time on federal activity.\n"
